document.getElementById('layer_contact').style.backgroundPositionY = offset*0.7 + "px";
document.getElementById('layer_calendar').style.backgroundPositionY = offset*0.7 + "px";
*/})

class App extends Component {
  state = {  }
  render() { 
    const Header = () => <h1>My header</h1>;
    const Footer = () => <h2>My footer</h2>;
    const Login = () => <p>Login Component</p>;    
    const Home = () => <p>Home Page</p>;
    const List = () => <p>List Page</p>;
    const Settings = () => <p>Settings Page</p>;
    const PageNotFound = () => <h1>Uh oh, not found!</h1>;
    const RouteWithLayout = ({ component, ...rest }) => {

      return (
        <div>
          <Header />
          <Route {...rest} render={ () => React.createElement(component) } />
          <Footer />
        </div>
      );
    };

    return (
      <Router>

        <Switch>

            <Route exact path="/up" component={SignInForm} />
            <RouteWithLayout exact path="/" component={Welcome} />
            <RouteWithLayout path="/list" component={List} />
            <RouteWithLayout path="/settings" component={Settings} />
            <Route path="*" component={PageNotFound} />
       </Switch>
      </Router>    



     );
  }
}

export default App;
